import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, NavDropdown, Nav, Form, FormControl, Button } from 'react-bootstrap';
const logo = require('../img/instagram.png');
const mic = require('../img/mic.png');
const profile_pic = require('../img/profile_pic.png');
const envolop = require('../img/envolop.png');
const heart = require('../img/heart.png');
class header extends Component {
  render() {
    return (

      <Navbar bg="light" expand="lg">

        <Navbar.Brand href="#home">
          <img
            src={logo}
            width="80"
            height="30"
            className="d-inline-block align-top"
            alt="intsa logo"
          />
        </Navbar.Brand>

        <Navbar.Collapse id="basic-navbar-nav">
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" border= "0" />
          <img
            src={mic}
            width="20"
            height="20"
            className="d-inline-block align-top"
            alt="mic"
          />

        </Form>

        <Navbar.Brand href="#home">

        <button 
          type="button" class="btn btn-danger">Danger</button>
          <img
            src={envolop}
            width="30"
            height="30"
            className="d-inline-block align-top"
            alt="intsa logo"
          />
          <img
            src={heart}
            width="30"
            height="30"
            className="d-inline-block align-top"
            alt="intsa logo"
          />
        </Navbar.Brand>

        <NavDropdown 
                title={

                        <img className="thumbnail-image" 
                            src={profile_pic} 
                            alt="user pic"
                            width="30"
                            height="30"
                        />

                } 
          id="basic-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown>

        </Navbar.Collapse>
    </Navbar>

    )
  }
}

export default header;
